import React from 'react'
import ReactPlayer from 'react-player/soundcloud'
import listeSons from './listeSons.json'




function Sons() {

    return (
        <div>
        {listeSons.map((son) => (
          <ReactPlayer
            key={son.id}
            height='20vh'
            width='90vw'
            url={son.url}
          />
))}

      </div>
    );
    }
  
  
  export default Sons;
